import PageTopBar from "@toptal/picasso/PageTopBar/PageTopBar";
import { Container, Section, Table } from "@toptal/picasso";

import data from "./data";

function App() {
  return (
    <Container>
      <PageTopBar variant="dark" title="Top heroes" />
      <Container>
        <Section title="Heroes">
          <Table>
            <Table.Head>
              <Table.Row>
                <Table.Cell>Name</Table.Cell>
                <Table.Cell>Hero</Table.Cell>
                <Table.Cell>Cape</Table.Cell>
                <Table.Cell>Universe</Table.Cell>
              </Table.Row>
            </Table.Head>
            <Table.Body>
              {data.map((row) => (
                <Table.Row key={row.id}>
                  <Table.Cell></Table.Cell>
                </Table.Row>
              ))}
            </Table.Body>
          </Table>
        </Section>
      </Container>
    </Container>
  );
}

export default App;
